import React from 'react';
import {Link} from 'react-router-dom'

function LinkHome (props) {
  return (
    <div
      className="linkLayout linkLayout--active">
      <Link
        to="/Home"
        className="link"
      >
        Главная
      </Link>
    </div>
  )
}

export default LinkHome
